import React from 'react';
import { CountdownCircleTimer } from 'react-countdown-circle-timer';
import './Browser.css'; // Import your custom CSS file

const CountdownTimer = () => {
  return (
    <div className="countdown-timer-container">
      <CountdownCircleTimer
        isPlaying
        duration={10} // Adjust the duration as needed
        colors={['#004777', '#F7B801', '#A30000', '#A30000']}
        strokeWidth={6} // Adjust the stroke width as needed
        size={150} // Adjust the size of the timer as needed
        trailColor="transparent" // Hide the trail
        isLinearGradient={true}
        rotation="counterclockwise" // Make the animation counterclockwise
      >
        {({ remainingTime, animatedColor }) => (
          <div className="timer-text">
            <div style={{ color: animatedColor }}>{remainingTime}</div>
          </div>
        )}
      </CountdownCircleTimer>
    </div>
  );
};

export default CountdownTimer;
